/* XnExtTLA_Item_iE_Extensions */

XnExtTLA_Item_iE_Extensions_element* asn1Get_XnExtTLA_Item_iE_Extensions 
   (ProtocolExtensionID id, XnExtTLA_Item_iE_Extensions* plist)
{
   if (0 != plist && plist->count > 0) {
      OSRTDListNode* pNode = plist->head;
      XnExtTLA_Item_iE_Extensions_element* pElem;
      while (0 != pNode) {
         pElem = (XnExtTLA_Item_iE_Extensions_element*) pNode->data;
         if (pElem->id == id) return pElem;
         pNode = pNode->next;
      }
   }
   return 0;
}

int asn1GetAll_XnExtTLA_Item_iE_Extensions 
   (OSCTXT* pctxt, ProtocolExtensionID id, XnExtTLA_Item_iE_Extensions* plist, 
   XnExtTLA_Item_iE_Extensions* pmatches)
{
   if (0 != plist && plist->count > 0) {
      OSRTDListNode* pNode = plist->head;
      XnExtTLA_Item_iE_Extensions_element* pElem;
      while (0 != pNode) {
         pElem = (XnExtTLA_Item_iE_Extensions_element*) pNode->data;
         if (pElem->id == id)  {
            if (!rtxDListAppend(pctxt, pmatches, pElem))
               return LOG_RTERR(pctxt, RTERR_NOMEM);
         }
         pNode = pNode->next;
      }
   }
   return 0;
}

